import React from 'react';
function Footer () {
    return (
        <footer className="footer">
           <div class="footer-logout">Se déconnecter</div>
           <div class="footer-content">
            <ul>
                <li>FAQ</li>
                <li>Nous contacter</li>
                <li>Mentions légales</li>
            </ul>
           </div>
    </footer>
    )
  }
  export default Footer;
